#вакансия #vacancy #казань

Разработчик PHP в СЭД Практика.

Компания рассматривает кандидатов только из Казани (КО) и готовых к переезду.
З/п: от 150 000 ₽ до 300 000 ₽ (на руки)
Формат работы: Офис,г.Казань, ул. Петербургская .
Уровень позиции: Middle, Senior

Стек проекта: PHP 8.3, PostgreSQL, JS, Vue.js, Memcached, Gearman, Git, ElasticSearch.

🔷Задачи:
Разработка и поддержка работоспособности существующего кода системы;
Оптимизация производительности системы под высокие нагрузки;
Работа с новыми и интересными технологиями (в том числе с ИИ);
Выявление и устранение ошибок систем, улучшение процессов разработки и рефакторинг кода.

🔷Обязательные требования:
Коммерческий опыт в PHP 7 от 2-х лет;
Знание принципов ООП и шаблонов проектирования;
Знание языка SQL;
Опыт использования систем контроля версий git;
Высшее образование.
Будет преимуществом:
Разработка под промышленные СУБД (PostgreSQL);
Опыт работы в консоли, Linux, опыт работы с ИИ, REST API, GraphQL.

Отклики ждем @fr_rec

#вакансия #vacancy #удаленно 

Архитектор DWH в крупный банк.

Компания рассматривает кандидатов только из России.
З/п: обсуждается индивидуально.
Формат работы: Офис, Удаленка, Гибрид(Москва, Питер, Сочи, Екатеринбург, Ростов-на-дону);
Уровень позиции: Senior

🔷Задачи:
Построение архитектуры DWH / Data Lake/ LakeHouse для высоконагруженных сервисов и больших хранилищ (500 тб+): ClickHouse (MergeTree), S3 Data Lake, Kafka, Airflow (ETL/ELT), etc;
Выбор форматов хранения: Parquet, ORC, Avro, JSON, таблицы MergeTree, Replicated, ReplacingMergeTree etc;
Участие в проектировании схем витрин под требования BI/DS/etc;
Проектирование слоёв: RAW → STG → ODS → DM → Marts;
Формирование архитектур ETL/ELT процессов с использованием Airflow / Spark;
Организация потоковой передачи данных из прод-сервисов (Kafka);
Настройка data quality checks и алертинга;
Формирование CI/CD пайплайнов для данных (git + tests + deploy);
Архитектурный надзор команд, валидация предлагаемых изменений, подготовка рекомендаций со стороны архитектуры;
Документирование решений и применяемых подходов;
Консультирование команд по стандартам, регламентам и архитектурным особенностям;
Участие в формировании, защите и реализации Data-стратегии функциональной области.

🔷Обязательные требования:
Опыт работы Lead Data Engineer /Архитектор DWH / DataOps от 3х лет;
Знание ClickHouse на уровне архитектора (MergeTree / Replacing / Collapsing);
Понимание архитектуры DataLake / LakeHouse;
Опыт построения пайплайнов: batch, micro-batch, stream;
Опыт работы с Airflow или аналогами;
Знание SQL уровня проектирования витрин и оптимизации;
Опыт настройки каталога данных: DataHub, OpenMetadata;
Опыт управления метаданными, версионированием схем.
Опыт с облачной инфраструктурой;
Хорошие знания *nix;
Знание технологий: Docker, Kubernetes.

Отклики ждем @fr_rec

#работа и #удаленка 

Привет! Мы, "Aspirity Solution", студия разработки, которая уже 10 лет создает веб и мобильные приложения для самых разных клиентов. 

Сейчас мы ищем AI-интегратора, который присоединится к нашим проектам. Если ты интересуешься ИИ и хочешь развиваться в этом направлении вместе с сильными разработчиками, мы рады видеть тебя в нашей команде!
Вилка з/п: часовая ставка $15-20
Формат: удаленка, гибкий график работы над задачами (дейли созвоны с командой в Тихоокеанском часовом поясе UTC-8)

Ты будешь заниматься настройкой AI-агентов через промпты и их интеграциями в проекты наших клиентов.

Что нужно, чтобы стать частью команды:
-опыт разработки на Python (около года);
-опыт настройки ИИ-агентов/промптинга со сложными запросами (классификация данных, формирование ответа по четкому шаблону);
-интерес к работе с языковыми моделями и стремление развиваться в этом направлении;
-знание языка шаблонов (например, Jinja), разметки markdown, yaml - будет преимуществом;
-уровень английского не ниже В2;
-самостоятельность и проактивность.

Рассмотрим кандидатов строго не из РФ и не из РБ.

для связи: hr@aspirity.com или https://t.me/hr_aspirity (Алина)

#работа и #удаленка 

