-зарплата в $, вилка до $4000.

Режим работы: гибкий график (по задачам и дедлайнам + созвоны с командой), PT (UTC-7) часовой пояс команды.
Рассмотрим кандидатов строго не из РФ и не из РБ.

для связи: hr@aspirity.com или https://t.me/hr_aspirity (Алина)

⚡️Айтишники В С Ё, официально: даже выпускники топовых технических вузов не могут устроиться на работу, а некоторые не проходят и на кассу в фудкорте.

🟠Компании почти перестали брать джунов, а собеседования стали настолько тяжёлыми, что не справляются даже кандидаты с огромным опытом;
🟠Один молодой специалист отправил отклики на 6 тысяч вакансий и не получил ни единого приглашения;
🟠В 2024 году в США уволили около 150 тысяч айтишников, в этом году – ещё 90 тысяч. Их заменяют нейросети;
🟠Уволенные специалисты, не имея других навыков, оказываются без шансов даже на самую простую работу;
🟠Эксперты говорят: золотая эпоха огромных зарплат программистов закончилась;
🟠Сегодня работу в IT найти гораздо сложнее, чем в SMM, райтинге или других гуманитарных сферах.

