FullStack-разработчик (Middle)

Мы — быстрорастущий стартап, создаём новый сервис, аналогичный по масштабу и амбициям ChatGPT. Сейчас ищем FullStack-разработчика на длительное сотрудничество, который сможет взять на себя как фронтенд, так и бэкенд, участвовать в создании архитектуры и развивать продукт вместе с нами.

🚀 Чем предстоит заниматься
 • Разработка нового веб-сервиса с нуля — от архитектуры до релиза MVP и последующей доработки;
 • Работа над фронтендом (React или Vue.js — выбирайте, с чем вам комфортнее);
 • Разработка бэкенда на Python (FastAPI, Django, Flask) или Node.js (Nest.js, Express);
 • Интеграция внешних API, баз данных и систем оплаты;
 • Участие в проектировании новой функциональности и улучшении UX;
 • Работа в команде стартапа — быстрое принятие решений, гибкие процессы, возможность влиять на продукт.

🛠 Технологический стек
 • Backend: Python (FastAPI/Django/Flask) или Node.js (Nest.js/Express) — не критично, выбираем оптимальное решение вместе;
 • Frontend: React или Vue.js — на ваш выбор;
 • Базы данных: PostgreSQL, MongoDB, Redis;
 • Инфраструктура: Docker, GitHub Actions/CI/CD (или аналоги);
 • Опыт работы с облачными сервисами (AWS/GCP/Azure) будет плюсом.

💼 Мы ожидаем
 • Опыт работы FullStack-разработчиком от 2 лет;
 • Уверенные знания JavaScript/TypeScript и одного из популярных фронтенд-фреймворков (React или Vue);
 • Опыт работы с серверным языком (Python или Node.js);
 • Понимание принципов REST API, баз данных, деплоя и CI/CD;
 • Умение работать самостоятельно и предлагать решения.

💸 Условия
 • Зарплата 100 000 – 150 000 ₽ на руки (по итогам собеседования, вилка открыта);
 • Полная занятость, удалённо;
 • Быстрый рост внутри компании: возможность вырасти до Senior и Lead по мере масштабирования продукта;
 • Минимум бюрократии, максимальное влияние на продукт.

🔥 Почему стоит к нам
 • Стартап на ранней стадии — можно влиять на архитектуру и ключевые решения;
 • Продукт с большими перспективами и амбициями выйти на массовый рынок;
 • Прямое взаимодействие с фаундерами, быстрые решения без лишних согласований;
 • Возможность расти вместе с проектом и карьерно, и финансово.

