У меня возникла проблема с типизацией вложенных навигаторов. Мой TS не подсказывает мне свойства параметров, которые требуется передать на вложенный экран
Вот мой код
import { NavigatorScreenParams, ParamListBase } from "@react-navigation/native"
import { NativeStackScreenProps } from "@react-navigation/native-stack"
import { Button, Text, View } from "react-native"

// константы с именами экранов и табов
const mainPage = "MainPage"
const oneTabTab = 'OneTabTab'
const secondPage = "SecondPage"
const tabWithPropsTab = 'TabWithPropsTab'

// тип таб-навигатора
interface MainPageParamList extends ParamListBase {

    [oneTabTab]: undefined
    [tabWithPropsTab]: {

        str: string
    }
}

// тип корневого навигатора
interface RootStackParamList extends ParamListBase {

    [mainPage]: NavigatorScreenParams<MainPageParamList>,
    [secondPage]: {

        secondId: number
    }
}

// тип пропсов для экрана, который передает табу параметры
type SecondProps = NativeStackScreenProps<RootStackParamList, typeof secondPage>

// компонент этого экрана
const Second = ({ route, navigation }: SecondProps) => {

    const { secondId } = route.params

    return (

        <View style={{
            marginTop: 200
        }}>

            <Text>My id is {secondId}</Text>

            <Button

                onPress={() => {

                    navigation.navigate(mainPage, {

                        screen: tabWithPropsTab,
                        params: {

                            // Здесь должны быть подсказки для объекта параметров, но их нет :(
                        }
                    })
                }}
                title="Go to paramsTag"
            />
        </View>
    )
}

