Подскажите плиз по код-стайлу для кнопки. Я всё время на shadcn писал, а щас вынужден свои варианты придумывать. Какие best practice вы знаете для этого?
Я не уверен, что мой вариант годный для вариации кнопок
interface ButtonProps extends ButtonHTMLAttributes<HTMLButtonElement> {
  variant?: string;
  children: ReactNode;
}

export const Button = ({ children, variant = "default", ...props }: ButtonProps) => {
  const variantClasses: Record<string, string> = {
    default: "px-4 py-2 bg-gray-200 text-black rounded hover:bg-gray-300",
    card: "transparent flex flex-col w-full cursor-pointer",
  };

  const className = variantClasses[variant] || variantClasses.default;

  return (
    <button className={className} {...props}>
      {children}
    </button>
  );
};

