🧑‍💻 Ищем разработчика React Native для создания приложения по переводу денежных средств

Описание проекта:
Нужно разработать мобильное приложение (iOS и Android) для переводов денежных средств между пользователями. Приложение должно включать базовый функционал:
• регистрация и верификация пользователей;
• пополнение и вывод средств;
• переводы между пользователями по номеру телефона или ID;
• история транзакций;
• уведомления (push + внутри приложения);
• интеграция с платежной системой (API будет предоставлено).

Требования:
• Опыт работы с React Native от 2 лет;
• Опыт интеграции с платёжными API;
• Понимание принципов безопасности финансовых приложений;
• Умение писать чистый, читаемый код;
• Желательно знание TypeScript и опыт работы с Firebase или аналогами.

Условия:
• Формат: удалённо;
• Оплата: процент от проекта;
• Сроки: обсуждаются, ориентировочно 1–2 месяца MVP;
• Возможность долгосрочного сотрудничества (доработка, поддержка).

Контакты: @Morshoff

